　■キッチン雑貨のプレゼントとしてかわいいうしシリコーン鍋つかみ2個セットはいかがですか？<br>
釣りの際は魚をダイレクトに掴まずにこれを使うと生臭さが手に付きません。<br>
■こちらの商品はメール便になります。<br>
■直射日光は避けてください。<br>
■検品作業をしてお客様に出荷出来るモノを出していますが目立たない程度の瑕疵は若干ございます。<br>
■サイズ：幅　約11cm×奥行　約9cm×高さ　約8cm<br>
■モニター環境により、実物との色合いに若干の違いがある場合がございます。<br>
